An attempt to implement support for batch requests that was discussed on the [development google group](https://groups.google.com/forum/#!topic/predictionio-dev/Fd_Dt2Lhvy4).
The specification can be found [here](https://docs.google.com/document/d/1byXQ7eM1pJ1g8O4hVBvEi1AuMSCx7osSrJk3FKwAaz4/edit). 
@dszeto You mentioned that I should create tasks on JIRA but I'm not sure what to create so please advise if I still need to.

I've asked about this feature [here](https://groups.google.com/forum/#!topic/predictionio-user/CZhkUQwsd90).

In short: deeplearning4j spark-nlp reads algorithm parameters from SparkConf. It makes sense to include these in engine.json. There is no way to set them currently: running "pio train -- --conf your.config.key1=your.config.value1 --config your.config.key2=your.config.value2" does **not** affect the spark context passed to the engine.

I didn't include any documentation in this patch as I'm not sure where should it go. Perhaps deploy/engineparams.html.md? But it's just a stub at the moment. 

An example engine.json:

``` json
{
  "id": "example",
  "description": "Example settings",
  "engineFactory": "org.template.word2vec.Word2VecEngine",
  "sparkConf": {
    "org.deeplearning4j.scaleout.perform.models.word2vec": {
      "negative": 0,
      "length": 100,
      "window": 5
    }
  },
  "datasource": {
    "params" : {
      "appId": 1
    }
  },
  "algorithms": [
    {
      "name": "algo",
      "params": {}
    }
  ]
}
```

This sparkConf section translates into a 

``` scala
Map(
  "org.deeplearning4j.scaleout.perform.models.word2vec.negative" -> "0",
  "org.deeplearning4j.scaleout.perform.models.word2vec.length" -> "100",
  "org.deeplearning4j.scaleout.perform.models.word2vec.window" -> "5" 
)
```
